import React from "react";

function ImagePopup(props) {
  return (
    <div className={`popup popup_for-preview`}>
      <div className="popup__preview-container">
        <button className="popup__close-icon popup__close-icon_for-preview" type="button"></button>
        <img src="#" alt="#" className="popup__image" />
        <h4 className="popup__name"></h4>
      </div>
    </div>
  )
}


export default ImagePopup;
